import axios from "axios";
import { useState } from "react";
import { useNavigate, useParams } from "react-router-dom";

const URI = 'http://localhost:8000/createDeportivo/';

const CompCreateDeportivo = () => {
    const navigate = useNavigate();
    const {ID_Direccion} = useParams() 
    const [Nombre, setNombre] = useState('')
    const [Horario_General, setHorarioGeneral] = useState('');
    const [Acepta_Mascotas, setAceptaMascotas] = useState('');
    const [dia1, setDia1] = useState('');
    const [dia2, setDia2] = useState('');
    const [horarioInicio, setHorarioInicio] = useState('');
    const [horarioFin, setHorarioFin] = useState('');
    const diasSemana = [
        'Lunes','Martes','Miercoles','Jueves','Viernes','Sábado','Domingo'
    ]
    // Procedimiento para actualizar
    const store = async (e) => {
        e.preventDefault();
        // en este caso pasamos la URI más la id, justo como se hizo en las pruebas con thunderclient
        const response = await axios.post(URI, { Nombre:Nombre, ID_Direccion: ID_Direccion,
            Horario_General: Horario_General,
            Acepta_Mascotas: Acepta_Mascotas,
        })
        // Verifica si la solicitud fue exitosa
        if (response.status === 201) { //Hay que modificar el controlador para que retorne el valor de la ID Direccion
            // Si es exitosa, obtén el ID de la dirección recién creada
            const ID_Deportivo = response.data.ID_Deportivo;

            // Ahora tienes el ID_Direccion, puedes hacer lo que necesites con él
            console.log("ID_Deportivo:", ID_Deportivo);
            navigate(`/createEncargado/${ID_Deportivo}`);
        } 
        // Regresamos al principio
    };

    const handleCrearCadena = (e) => {
        e.preventDefault(); // Evita que el formulario se envíe y la página se recargue
        const cadena =
          `${dia1} a ${dia2}` +
          ` de ${horarioInicio} a ${horarioFin}`;
        setHorarioGeneral(cadena);
      };
    
    return (
        <div className="formulario">
            <h1>Editar Deportivo</h1>
            <form onSubmit={store}>
            <   div className="form-group">
                    <label>Nombre</label>
                    <input type="text" value={Nombre} onChange={(e) => setNombre(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Horario General</label>
                <div>
                    <label>Día 1:</label>
                        <select value={dia1} onChange={(e) => setDia1(e.target.value)}>
                        <option value="">Selecciona un día</option>
                        {diasSemana.map((dia, index) => (
                            <option key={index} value={dia}>{dia}</option>
                        ))}
                        </select>
                    </div>
                    <div>
                        <label>Día 2:</label>
                        <select value={dia2} onChange={(e) => setDia2(e.target.value)}>
                        <option value="">Selecciona un día</option>
                        {diasSemana.map((dia, index) => (
                            <option key={index} value={dia}>{dia}</option>
                        ))}
                        </select>
                    </div>
                <div>
                        <label>Horario:</label>
                        <input type="time" value={horarioInicio} onChange={(e) => setHorarioInicio(e.target.value)} />
                        <span> a </span>
                        <input type="time" value={horarioFin} onChange={(e) => setHorarioFin(e.target.value)} />
                    </div>
                    <input type="text" value={Horario_General} onChange={(e) => setHorarioGeneral(e.target.value)} className="form-control" disabled />
                </div>
                <div className="form-group">
                <button onClick={handleCrearCadena}  className="btn btn-primary">Generar Horario</button>
                    <label>Acepta Mascotas?</label>
                    <input type="checkbox" checked={Acepta_Mascotas} onChange={(e) => setAceptaMascotas(e.target.checked)} />
                </div>               
                <button type="submit" className="btn btn-primary">Crear Deportivo</button>
            </form>
        </div>
    );
}

export default CompCreateDeportivo;
